INSERT INTO `evenements` (`id`, `dateFinal`, `nom`, `description`, `image_id`, `user_id`, `region_id`, `validé`) VALUES
(1, '2019-07-23', 'Le Monde en sphères', 'Conçue par la BnF et présentée au Louvre Abou Dhabi au printemps dernier, l\'exposition retrace 2500 ans d\'une histoire des sciences et des représentations qui conduit le visiteur d\'un monde sphérique clos, immuable et centré sur la Terre à un univers infini et mouvant, en perpétuelle évolution. Près de 200 oeuvres impressionnantes, objets d\'art et de savoir, issus des collections de la BnF et de prêts exceptionnels venus de bibliothèques et musées prestigieux incarnent cette vision sphérique du monde : globes terrestres et célestes, sphères armillaires, astrolabes et manuscrits...', 5, 4, 4, 1),
(2, '2019-05-22', 'LE JOUR DE LA TERRE', 'À l\'approche de sa 49e édition, la France entière se mobilise le 22 avril, pour le Jour de la Terre, le\r\n\r\nmouvement écologiste le plus important de la planète : plus d\'un milliard de personnes dans 193\r\n\r\npays passent à l\'action, chaque année, et célèbrent le Jour de la Terre, pour le respect et la\r\n\r\nprotection de la planète. Après un succès retentissant à travers la France en 2018, cette année\r\n\r\nencore, les municipalités françaises du continent et des DOM s\'engagent en faveur de\r\n\r\nl\'environnement.\r\n\r\nConscient des enjeux environnementaux et de ses conséquences, parfois dramatiques, sur ses\r\n\r\nmilieux de vie et étant convaincu qu\'elle peut faire partie de LA solution, la Métropole AixMarseille-Provence, à l\'instar de nombreuses communes participe aux célébrations. En effet, la\r\n\r\ndirectrice de l\'association le Jour de la Terre France, Anne-Claire Jacquet, ainsi que Monique Cordier,\r\n\r\nvice-présidente déléguée à la propreté du conseil de territoire Marseille Provence de la métropole\r\n\r\nAix-Marseille-Pr', 6, 1, 21, 2),
(3, '2019-05-23', 'SEMAINE EUROPÉENNE DE RÉDUCTION DES DÉCHETS', 'Inscrite dans le cadre de la campagne nationale sur la réduction des déchets, la SERD donne rendez-vous aux entreprises, aux collectivités et au grand public du 18 au 26 novembre. L’idée : expliquer comment mieux consommer, mieux produire et prolonger la durée de vie des produits. Mais puisqu’aucune politique de prévention ne peut encore réduire à zéro la production de déchets, rien ne vous empêche d’agir pour la planète en recyclant les vôtres au sein de votre société. Une démarche dans laquelle Easy Recyclage sera d’ailleurs ravi de vous accompagner.', 9, 1, 15, 0),
(4, '2020-05-22', 'LA SEMAINE EUROPÉENNE DU DÉVELOPPEMENT DURABLE', 'Comme chaque année depuis 2003, cet évènement se chargera du 30 mai au 5 juin de sensibiliser le grand public aux bienfaits du développement durable. Mais si sa mission générale est de promouvoir les démarches individuelles et collectives, l’édition 2017 mettra plus spécifiquement en lumière les 17 objectifs de développement durable édictés par l’ONU dans le cadre de l’agenda 2030 (comme l’éradication de l’extrême-pauvreté et la résolution du changement climatique). Les entreprises, les citoyens, les écoles, les associations ou encore les musées de l’Europe entière seront alors encouragés à organiser diverses actions en ce sens, qui est tout simplement le bon. Alors ouvrez l’œil, ou participez !', 10, 3, 14, 1);

